t 1.1\",\"params\":{\"text\":\"<h3><strong>REPRODUCTION OF FLOWERING PLANTS</strong></h3>\\n\"},\"subContentId\":\"4d431da1-7cb5-4528-985d-0ac712ef31cf\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":6.6371681415929,\"width\":33.370660694289,\"height\":12.83185840708,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>In flowering plants, the <strong>reproductive organs</strong> are located<strong> inside the flowers</strong>.</p>\\n\"},\"subContentId\":\"832d061a-7621-495f-b54f-07b8b7c8b814\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":17.699115044248,\"width\":32.250839865622,\"height\":10.619469026549,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>A flower is composed of a <strong>floral part</strong> and a <strong>reproductive part</strong>.</p>\\n\"},\"subContentId\":\"35996b46-626b-4bca-9481-aaafe9b6304d\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":30.973451327434,\"width\":39.977603583427,\"height\":43.805309734513,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><em><strong>The floral part</strong></em> includes:<br />\\nThe <strong>petals</strong> and the <strong>sepals</strong>. The group of petals form the <strong>corolla</strong> and the group of sepals form the <strong>calyx</strong>.<br />\\nThe<strong> receptacle</strong>, a thickened part of the peduncle where the parts of the flower are attached.<br />\\nThe<strong> peduncle</strong> a small stalk that attaches the flower to the main stem of the plant.</p>\\n\"},\"subContentId\":\"15683cdc-9a5c-45ef-8058-3ccd140045bc\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":81.858407079646,\"width\":99.776035834267,\"height\":15.044247787611,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><em><strong>The reproductive part</strong></em> includes the <strong>stamens</strong> (male organs) and the<strong> pistils</strong> (or carpels) (female organs).<br />\\nThe stamen is made up of the<strong> filament</strong> and the <strong>anther</strong>.<br />\\nThe pistil is made up of the <strong>stigma</strong>, the <strong>style</strong> and the <strong>ovary </strong>which contains the <strong>ovule(s)</strong>.</p>\\n\"},\"subContentId\":\"728e8771-be69-417b-970a-fca6fab39dd7\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"}],\"slideBackgroundSelector\":{}},{\"slideBackgroundSelector\":{},\"elements\":[{\"x\":1.1198208286674,\"y\":7.4336283185841,\"width\":98.656215005599,\"height\":50.442477876106,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4Q1YRXhpZgAATU0AKgAAAAgADAEAAAMAAAABAyAAAAEBAAMAAAABARcAAAECAAMAAAADAAAAngEGAA 20716685,\"y\":79.66814159292,\"width\":18.812989921613,\"height\":19.911504424779,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.75em\\\">The hypocotyl elongates and drags with it the cotyledons. It will form the part of the stem below the cotyledons.</span></p>\\n\"},\"subContentId\":\"aa21b481-bc91-48e1-9e69-d9941ab8d7fd\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":50.391937290034,\"y\":81.858407079646,\"width\":18.812989921613,\"height\":10.619469026549,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.75em\\\">The terminal bud gives a stem and two simple leaves. </span></p>\\n\"},\"subContentId\":\"0a635f5b-7973-4269-8348-755e38c635e6\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":73.124300111982,\"y\":80.088495575221,\"width\":26.651735722284,\"height\":19.469026548673,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:0.75em\\\">Growth will continue. The cotyledons will dry and fall. New compound leaves appear. When the stem and leaves develop, the plant becomes autonomous.</span></p>\\n\"},\"subContentId\":\"f0bb80f9-1c19-419d-8d04-40fdf8c6b446\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\ le\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":32.474804031355,\"y\":30.973451327434,\"width\":49.048152295633,\"height\":15.044247787611,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>A- </strong>A potato tuber is an underground stem that contains <span style=\\\"color:#8B4513\\\"><strong>buds</strong></span> called eyes. If the tuber is planted, each eye is capable of developing into a new potato.</p>\\n\"},\"subContentId\":\"312922de-f723-4425-93ca-690098d24c5e\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":50.391937290034,\"y\":46.46017699115,\"width\":49.048152295633,\"height\":15.044247787611,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>B-</strong> An onion <span style=\\\"color:#8B4513\\\"><strong>bulb</strong></span> is a short modified stem made up of a central shoot surrounded by modified leaves that contain stored food. The bulb gives a new plant.</p>\\n\"},\"subContentId\":\"03321df6-1bd6-4215-87b1-f948dddd24a8\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":32.474804031355,\"y\":24.336283185841,\"width\":59.126539753639,\"height\":4.8672566371681,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Vegetative multiplication can be natural like in the below examples:</p>\\n\"},\"subContentId\":\"1451208d-c470-43d1-bd0e-3402ef27ee51\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":4.4247787610619,\"width\":99.776035834267,\"height\":19.469026548673,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>Some flowering plants have a mode of reproduction that does not involve fertilization and seeds.<br />\\nThis mode of reproduction is called <strong>vegetative multiplication</strong> where various organs from the mother plant are capable of giving birth to a new plant. These organs are called<strong> vegetative organs</strong> (which are organs <strong>other than flowers</strong>). They include stems, leaves, buds, and roots.</p>\\n\"},\"subContentId\":\"e6fa3b71-f325-4eea-9b4a-3abee52c9b00\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":34.71444568869,\"y\":63.495575221239,\"width\":58.006718924972,\"height\":19.469026548673,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>C- </strong>Vegetative propagation of strawberries happens through <strong><span style=\\\"color:#8B4513\\\">stolons</span></strong> or runners. These are <strong>aerial</strong> stems that grow horizontally on the surface of the soil. Every stolon carries a bud at its extremity. This extremity roots itself and a new strawberry plant appears.</p>\\n\"},\"subContentId\":\"600dfbf5-2c0a-407c-aa6c-bd5f2a8e9b7c\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":51.511758118701,\"y\":84.070796460177,\"width\":48.264277715566,\"height\":15.044247787611,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><strong>D- </strong>Iris is a beautiful flower that can reproduce asexually via <span style=\\\"color:#8B4513\\\"><strong>rhizomes</strong></span>. Rhizomes are horizontal <strong>underground</strong> stems that give rise to new shoots and roots.</p>\\n\"},\"subContentId\":\"a51f9c70-89f6-4b8b-a45d-2783a2f03947\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"}],\"slideBackgroundSelector\":{}},{\"elements\":[{\"x\":0,\"y\":0,\"width\":25.531914893617,\"height\":4.8672566371681,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"color:#A9A9A9\\\"><span style=\\\"font-size:0.875em\\\"><strong>VEGETATIVE MULTIPLICATION</strong></span></span></p>\\n\"},\"subContentId\":\"a1e60167-f7c3-4e6d-a9a7-c4616b21556d\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":64.159292035398,\"width\":99.776035834267,\"height\":23.893805309735,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>The advantages of vegetative reproduction include:</p>\\n\\n<p>- it takes less time to grow.<br />\\n- it bears flowers and fruits early.<br />\\n- the new plant exactly resembles the mother plant (once you have a good plant, you can reproduce it many times).</p>\\n\"},\"subContentId\":\"e7e50b64-f4ba-4a0b-b5e8-cd90166253f1\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":0,\"y\":88.938053097345,\"width\":99.776035834267,\"height\":10.619469026549,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p>While some flowering plants can use both sexual and asexual reproduction to multiply, such as strawberries and potatoes, some others can only reproduce via vegetative multiplication like banana trees.</p>\\n\"},\"subContentId\":\"f0c70006-c1a7-4a11-a8cd-c3c18d829ef5\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"invisible\":false,\"solution\":\"\",\"buttonSize\":\"big\",\"goToSlideType\":\"specified\"},{\"x\":86.540880503145,\"y\":4.9751243781095,\"width\":13.213885778275,\"height\":32.079646017699,\"action\":{\"library\":\"H5P.Image 1.1\",\"params\":{\"contentName\":\"Image\",\"alt\":\"Cutting\",\"file\":{\"path\":\"data:image/jpeg;base64,/9j/4AAQSkZJRgABAQEBLAEsAAD//gBhRmlsZSBzb3VyY2U6IGh0dHBzOi8vY29tbW9ucy53aWtpbWVkaWEub3JnL3dpa2kvRmlsZTpBZHZlbnRpdGlvdXNfcm9vdHNfb2ZfTWFnbm9saWFfY3V0dGluZy5qcGf/2wBDAAYEBQYFBAYGBQYHBwYIChAKCgkJChQODwwQFxQYGBcUFhYaHSUfGhsjHBYWICwgIyYnKSopGR8tMC0oMCUoKSj/2wBDAQcHBwoIChMKChMoGhYaKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCgoKCj/wAARCAEaANwDASIAAhEBAxEB/8QAHQAAAgEFAQEAAAAAAAAAAAAAAQIAAwQFBggHCf/EAEIQAAEDAgQDBQYEAggGAwAAAAEAAgMEEQUSITEGQWEHEyJRcQgUMoGRoRVCUsEjsRYkM2KistHhcnOCksLwJmPD/8QAGgEBAQEBAQEBAAAAAAAAAAAAAAECAwQFBv/EACMRAQEAAgICAQUBAQAAAAAAAAABAhEDIRIxEwQiMkFRFGH/2gAMAwEAAhEDE
